window.bookSummaryJSON = "<p><b>An outcast. A prince. And a deadly rebellion....</b></p> <p>After a lifetime of rejection, seamstress Evie can't trust Frederic, the crown prince of Lanover - not his words of friendship or the way the warmth in his eyes seems to ask for even more. But when they end up on a tour of his kingdom - one filled with increasing danger - Evie's mistrust might doom them all. </p> <p>In this spin on the classic fairy tale, an ugly duckling must discover her true worth in order to save her kingdom and maybe even find true love.</p>"; 
